function [qk1, biask1, wk1, Pk1, phi] = EKF_with_sun(q_meas,w_meas,S_meas,dt,st_status,Si,wmag_thresh,sigma_r,sigma_w,sigma_meas,sigma_ss,qk,biask,Pk)
%#codegen

%propagate state (1)
w = w_meas - biask; %biask = biask1 before correction because bias is assumed constant over the interval

wmag = norm(w);

%qk1 = expm(dt/2*Omega(w))*qk;

%0th order
if wmag > wmag_thresh;
    qk1 = (eye(4)*cos(wmag/2*dt) + 1/wmag*sin(wmag/2*dt)*Omega(w))*qk;
else
    qk1 = (eye(4) + dt/2*Omega(w))*qk;
end


%propagate covariance (2)
%build STM
if wmag > wmag_thresh;
    Phi_11 = eye(3) - 1/wmag*sin(wmag*dt)*skew(w) + 1/wmag^2*(1 - cos(wmag*dt))*skew(w)^2;
    Phi_12 = -eye(3)*dt + 1/wmag^2*(1 - cos(wmag*dt))*skew(w) - 1/wmag^3*(wmag*dt - sin(wmag*dt))*skew(w)^2;
else
    Phi_11 = eye(3) - dt*skew(w) + (dt^2/2)*(skew(w)^2);
    Phi_12 = -eye(3)*dt + (dt^2/2)*skew(w) - (dt^3/6)*(skew(w)^2);
end
Phi_21 = zeros(3);
Phi_22 = eye(3);
Phi = [Phi_11,Phi_12;Phi_21,Phi_22];

% F = [skew(-w),-eye(3);zeros(3),zeros(3)];
% Phi = eye(6) + F*dt + 0.5*F^2*dt^2;

%noise covariance matrix
Qd_11 = sigma_r^2*dt*eye(3) + sigma_w^2*eye(3)*dt^3/3;
Qd_12 = -sigma_w^2*eye(3)*dt^2/2;
%Qd_12 = zeros(3);
Qd_22 = sigma_w^2*dt*eye(3);
Qd = [Qd_11,Qd_12;Qd_12,Qd_22];

%propagate covariance
Pk1 = Phi*Pk*Phi' + Qd;


%compute Kalman gain (3)
%observation matrix
xi = Xi(qk1);
H_st = [0.5*xi,zeros(4,3)];

R_i2b = qtodcm(qk1);
%H_ss = [2*skew(R_i2b*Si),zeros(3)];
H_ss = [skew(R_i2b*Si),zeros(3)];

%covariance of the residual
R_st = diag([sigma_meas^2 sigma_meas^2 sigma_meas^2 sigma_meas^2]);
R_ss = diag([sigma_ss^2 sigma_ss^2 sigma_ss^2]);

%residual = meas - ref
r_st = q_meas - qk1;
r_ss = S_meas - R_i2b*Si;
if st_status == 1
    H = [H_st;H_ss];
    R = blkdiag(R_st,R_ss);
    r = [r_st;r_ss];
elseif st_status == 2 %star tracker only
    H = H_st;
    R = R_st;
    r = r_st;
else %sun sensor only
    H = H_ss;
    R = R_ss;
    r = r_ss;
end


S = H*Pk1*H' + R;
%Kalman gain
K = Pk1*H'*inv(S);

%update state(4)
delta_x = K*r;

%for inertia est
phi = delta_x(1:3);

%update quaternion
qk1 = qk1 + 0.5*Xi(qk1)*delta_x(1:3);
qk1 = qk1/(sqrt(sum(qk1.^2)));

%update bias
biask1 = biask + delta_x(4:6);

%update angular velocity prediction
wk1 = w_meas - biask1;

%update covariance (5)
Pk1 = Pk1 - K*S*K';
end

function Om = Omega(w)
Om = [0,w(3),-w(2),w(1);-w(3),0,w(1),w(2);w(2),-w(1),0,w(3);-w(1),-w(2),-w(3),0];
end

function xhat = skew(x)
% Computes the hat map, mapping a 3-vector into a 3X3 skew-symmetric matrix
xhat = [  0   -x(3)  x(2)
         x(3)   0   -x(1)
        -x(2)  x(1)  0];
end

function R = qtodcm(q)
R = (q(4)^2 - q(1:3)'*q(1:3))*eye(3) + 2*q(1:3)*q(1:3)' - 2*q(4)*skew(q(1:3));
end

function z = Xi(q)
z = [q(4)*eye(3) + skew(q(1:3));-q(1:3)'];
end
